const Item = ({name}) => {
  return <li>name</li>
}

function Skills() {
  return (
    <>
      <section>
        <h1>Skills Section</h1>
        <ul>
          <li><Item name="Web Designing"/></li>
        </ul>
      </section>
    </>
  )
}

export default Skills;
